package syntaxtree;import symbol.*;import visitor.InterpreterVisitor;import visitor.Visitor;import visitor.TypeVisitor;public class NewObject extends Exp {  public Identifier i;    public NewObject(Identifier ai, Position p) {    i=ai;position=p;  }  public void accept(Visitor v) {    v.visit(this);  }  public Type accept(TypeVisitor v) {    return v.visit(this);  }    public ClassSymbol accept(InterpreterVisitor v) {	  return v.visit(this);  }}